import { ReactDOM } from 'react-dom';


const Sidedrawer = (props) => {

    return(

    <aside className='fixed inset-0 h-full w-3/4 bg-white flex-row justify-center items-center'>
        <div>Home</div>
        <div>Signin</div>
        <div>Signup</div>
    </aside>

)

}

